import React from 'react';
import './App.css';
import { BrowserRouter as Router } from "react-router-dom";
import HomePage from "./components/Ppages/HomePage/HomePage";

function App() {
  return (
    <Router>
        <Route path='/' component={<HomePage/>}/>

    </Router>
  );
}

export default App;
